import React from "react";
const App = () => {
    return (
        <>
            <div className="main_div">
                <div className='center_div'>
                    <h1>ToDo List</h1>
                    <input type='text' placeholder='Add Items' onChange={inputEvent} />
                    <button className='btn' onClick={submit}></button>
                </div>

            </div>
        </>
    )
}

export default App;
